import React from 'react'
import ReactFlow, { Controls, Background } from 'reactflow';
import 'reactflow/dist/style.css';
function Demo2() {
    


    return (
        <>
            <div style={{ height: '100%' }}>
                <ReactFlow nodes={nodes} edges={edges}>
                    <Background />
                    <Controls />
                </ReactFlow>
            </div>
        </>
    )
}
export default Demo2;
